In the mini Java to MIPS32 compiler, the usability of the language constructs is defined by the grammar rules and structural conventions used in the code. Here are the key components that contribute to the usability of mini Java programs: Start Symbol (Program) : The starting point of a mini Java program is defined by a MainClass followed by zero or more ClassDecl. MainClass : A main class is defined by the following syntax: class id { public static void main(String[] id) { Statement }
} This structure specifies the class containing the main method, which serves as the entry point for program execution. Class Declaration (ClassDecl) : The syntax for defining a class is: class id { VarDecl* MethodDecl*
} Optionally, a class can extend another class using the syntax: class id extends id { VarDecl* MethodDecl*
} This structure defines the properties and methods associated with a class. Variable Declaration (VarDecl) : Variables are declared using the syntax Type id;, specifying the data type and identifier for the variable. Method Declaration (MethodDecl) : Methods are declared with the syntax: public Type id(FormalList) { VarDecl* Statement* return Exp;
} This structure defines the signature, parameters, and body of a method. Formal Parameters (FormalList) : Formal parameters are specified as a list of data types and identifiers, with optional additional parameters defined by FormalRest. These conventions ensure consistency and readability in mini Java code, enhancing its usability and maintainability. ⬆️

