This table of symbols is a part of the semantic analysis phase of the compiler. It is responsible for building a symbol table that keeps track of the names and types of variables and functions in the program. The symbol table is used by other parts of the compiler, such as the type checker and code generator, to ensure that the program is well-formed and to generate correct code. // Implementation of the SymbolTableVisitor
public class SymbolTableVisitor implements Visitor<Void> { private MainTable mainTable = new MainTable(); private ClassTable currentClassTable = null; private MethodTable currentMethodTable = null; private final ArrayList<SymbolTableException> errors = new ArrayList<>(); private final boolean ignoreExtends = false; public Void visit(And a) { return null; } public Void visit(BooleanType b) { return null; } { ...}
}

