In our compiler, we have implemented a type checking visitor that traverses the AST and performs type checking on the AST nodes. The type checking visitor is implemented as a subclass of the AST visitor. The type checking visitor implements the visit methods for each AST node type. The visit methods perform type checking on the AST nodes. The class TypeCheckingVisitor implements Visitor<Type> and SemanticAnalysisStrategy // T is the return type of the visitor, which is Type in this case
public interface Visitor<T> { T visit(And a); T visit(BooleanType b); { ...}
} // SemanticAnalysisStrategy is an interface that defines a method
// to check the semantics of a program
public interface SemanticAnalysisStrategy { boolean isSemanticsOk(Program program); void isSemanticsOkOrThrow(Program program) throws SemanticAnalysisException;
}
